        super(props)

        this.state = {
            hasBeenSearched: false
        }
    }

    render() {

        const show = (this.state.hasBeenSearched) ? <Map /> : <div> nothing has been searched  </div>

        return (
            <div>
                {show}
                <Form >this is a form</Form>
            </div>
        )
    }
}
